  const [page, setPage] = useState("banker")


  const changePage = (pageName) => {setPage(pageName)}

  const switchPage = () => {
    switch (page) {

        case "banker":
        return <Banker changePage={changePage} />

  }   

}




  return (
    <div className="App">
    <Router>
         <Routes>
            <Route path='/' element ={<Login changePage={changePage}/>}/>
            <Route path='/register' element ={<Register/>}/>
         </Routes> 

      </Router>
      {switchPage()}
    </div>
  );
}

export default App;
